In Power Automate, you can't directly change the background color of an adaptive card as it's not a supported property. However, you can use a workaround by using an image as the background and overlaying the text and other elements on top of it.

Here's a simple example of how you can create an adaptive card with a background color using an image:

1. First, you need to upload the image with the desired background color to your SharePoint, OneDrive, or any other storage that Power Automate can access.

2. In Power Automate, create a new flow and add a 'Compose' action. In the 'Content' field, enter the URL of the image you uploaded.

3. Add another 'Compose' action and set the 'Content' field to the following JSON:

```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "TextBlock",
            "text": "Your Text Here",
            "wrap": true
        }
    ],
    "actions": [],
    "image": {
        "url": "@body('Compose_2')"
    },
    "style": {
        "title": "plain",
        "spacing": "none"
    }
}
```

