To create an onSubmit function that sends form data to a GraphQL API, you can use the Apollo Client library in your React project. Here's a step-by-step guide on how to achieve this:

1. First, make sure you have Apollo Client installed in your project. If not, install it using npm or yarn:

```bash
npm install apollo-client graphql
```

or

```bash
yarn add apollo-client graphql
```

2. Import the necessary dependencies in your component file:

```javascript
import React, { useState } from 'react';
import { useMutation, gql } from '@apollo/client';
import { useForm } from 'react-hook-form';
import { ApolloClient, InMemoryCache } from '@apollo/client';
```

3. Create a GraphQL mutation to send the form data:

```javascript
const CREATE_DATA_MUTATION = gql`
  mutation CreateDataMutation($input: CreateDataInput!) {
    createData(input: $input) {
      id
      name
      // Add other fields as needed
    }
  }
`;
```

4. Initialize the Apollo Client:

```javascript
const client = new ApolloClient({
  uri: '/graphql', // Replace with your GraphQL API URL
  cache: new InMemoryCache(),
});
```

5. Use the `useMutation` hook to execute the mutation:

```javascript
const [createData, { loading, error }] = useMutation(CREATE_DATA_MUTATION);
```

6. Create a form using `useForm` from `react-hook-form`:

```javascript
const { register, handleSubmit } = useForm();
```

7. Define the form fields and create the onSubmit function:

```javascript
const onSubmit = (data) => {
  createData({ variables: { input: data } });
};
```

8. Render the form and handle the form submission:

```javascript
return (
  <form onSubmit={handleSubmit(onSubmit)}>
    <input type="text" {...register('name')} />
    {/* Add other form fields as needed */}
    <button type="submit">Submit</button>
  </form>
);
```

