Here's a function that takes a `date` (a `Date` object) representing the post's timestamp and returns the elapsed time since the post was made in the format "YYYY-MM-DD HH:mm:ss".

```typescript
function getElapsedTime(date: Date): string {
  const now = new Date();
  const diffInMilliseconds = now.getTime() - date.getTime();

  const seconds = Math.floor((diffInMilliseconds / 1000) % 60);
  const minutes = Math.floor((diffInMilliseconds / (1000 * 60)) % 60);
  const hours = Math.floor((diffInMilliseconds / (1000 * 60 * 60)) % 24);
  const days = Math.floor(diffInMilliseconds / (1000 * 60 * 60 * 24));

  if (days > 0) {
    return `${days} days ago`;
  }

  if (hours > 0) {
    return `${hours} hours ago`;
  }

  if (minutes > 0) {
    return `${minutes} minutes ago`;
  }

  return `${seconds} seconds ago`;
}
```

